import Vue from 'vue';
import ElementUI from 'element-ui';
import 'element-ui/lib/theme-chalk/index.css';
import App from './App.vue';
import global_ from '../config/global.js'
import router from './router'
Vue.prototype.GLOBAL = global_;
Vue.use(ElementUI);

new Vue({
  el: '#app',
  router,
  render: h => h(App)
});
